import React from "react";

function AboutSection() {
  return (
    <section className="about-section">
      <div className="about-img">
        <img src="dog-about.jpg" alt="About PupBar" className="circle-img" />
      </div>
      <div className="about-content">
        <h2>ABOUT US</h2>
        <p>
          PupBar is not just a pet grooming spot, it's a vision brought to life
          in 2023. Our team of elite stylists offer more choice and convenience
          to pet owners.
        </p>
        <button className="about-btn">LEARN MORE</button>
      </div>
    </section>
  );
}

export default AboutSection;
